import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';

const DeletePanel = ({show, onHide, str}) =>{
  return (
    <Modal
      show = {show}
      onHide={onHide}
    >
        <Modal.Header closeButton>
          <Modal.Title style={{color: "red"}}>Удалить {str}</Modal.Title>
        </Modal.Header>

        <Modal.Body>
          <p> Вы действительно хотите удалить {str}?
              <br/>Отменить это действие будет невозможно.</p>
        </Modal.Body>

        <Modal.Footer>
          <Button variant="secondary" onClick={onHide}>Close</Button>
          <Button variant="primary" onClick={onHide}>Save changes</Button>
        </Modal.Footer>
      </Modal>
  );
};

export default DeletePanel;
